import React from 'react'
import Loggedin from './Loggedin'
import Login from './Login'
const SplitPage = () => {
    let isLoggedIn=JSON.parse(localStorage.getItem("isLoggedIn"));
    return (
        <div>
            {isLoggedIn?<Loggedin/>:<Login/> }
        </div>
    )
}

export default SplitPage
